import PropTypes from 'prop-types';
import { useState } from 'react';
import Button from '../../shared/Button/Button';

const Section = props => {
    const [isEdited, setIsEdited] = useState(true);

    const { title, children, ...sectionProps } = props;

    return (
        <section className='flex flex-col mb-16 bg-white p-8 rounded-3xl shadow-sm' {...sectionProps}>
            <h1 className='text-2xl font-semibold mb-5'>{title}</h1>
            <div className='flex-col max-w-3xl'>{children}</div>
        </section>
    );
};

Section.propTypes = {
    title: PropTypes.string,
};

export default Section;
